import {Button} from "react-bootstrap";
import {Link} from "next";
import next from "next";

class Home extends React.Component {
  render() {
    return (
      <div>
        <h1>Home Page</h1>
        <Link href={'/students'}>
        <Button variant="solid">
          Tester Button Solid</Button>
        </Link>

        <Button variant="outline">Tester Button Outline</Button>
      </div>
    )
  }
}

export default Home;
